import React, { useState, useRef, useEffect } from "react";
import { ActivityIndicator, View, Image, Animated, Easing } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createStackNavigator } from "@react-navigation/stack";
import { Provider as PaperProvider } from "react-native-paper";
import { StatusBar } from "expo-status-bar";
import { useFonts } from "expo-font";
import Icon from "react-native-vector-icons/MaterialIcons";

// Components
import WelcomeScreen from "./src/components/WelcomeScreen";

// Screens
import HomeScreen from "./src/screens/HomeScreen";
import CameraScreen from "./src/screens/CameraScreen";
import RecommendationsScreen from "./src/screens/RecommendationsScreen";
import ProfileScreen from "./src/screens/ProfileScreen";
import RoomAnalysisScreen from "./src/screens/RoomAnalysisScreen";
import TestErrorScreen from "./src/screens/TestErrorScreen";

// Theme
import { theme } from "./src/theme/theme";

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();

function TabNavigator() {
  // Base64 icon sources - replace these with your actual base64 strings
  const base64Icons = {
    Home: "", // Replace with your base64 string
    Camera: "", // Replace with your base64 string
    Recommendations: "", // Replace with your base64 string
    Profile: "", // Replace with your base64 string
  };

  const getIconSource = (routeName: string) => {
    const base64Icon = base64Icons[routeName as keyof typeof base64Icons];
    
    if (base64Icon) {
      return { uri: `data:image/png;base64,${base64Icon}` };
    }
    
    // Fallback to require() for local assets
    switch (routeName) {
      case 'Home':
        return require('./assets/icons/House.png');
      case 'Camera':
        return require('./assets/icons/camera.png');
      case 'Recommendations':
        return require('./assets/icons/recommendations.png');
      case 'Profile':
        return require('./assets/icons/profile.png');
      default:
        return require('./assets/icons/House.png');
    }
  };

  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          const iconSource = getIconSource(route.name);

          return (
            <Image 
              source={iconSource} 
              style={{ 
                width: 36, 
                height: 36,
              }} 
              resizeMode="contain"
            />
          );
        },
        tabBarActiveTintColor: '#5D8658',
        tabBarInactiveTintColor: '#6B7280',
        tabBarStyle: {
          backgroundColor: '#fff8e6',
          borderTopWidth: 1,
          borderTopColor: '#f0e6c8',
          height: 88,
          paddingBottom: 20,
          paddingTop: 8,
        },
        tabBarLabelStyle: {
          fontSize: 13,
          fontFamily: 'Poppins-Regular',
          marginTop: 4,
          marginBottom: 4,
        },
        headerShown: false,
      })}
    >
      <Tab.Screen name="Home" component={HomeScreen} />
      <Tab.Screen name="Camera" component={CameraScreen} />
      <Tab.Screen name="Recommendations" component={RecommendationsScreen} />
      <Tab.Screen name="Profile" component={ProfileScreen} />
    </Tab.Navigator>
  );
}

export default function App() {
  const [fontsLoaded] = useFonts({
    'Poppins-Light': require('./assets/fonts/poppins/Poppins-Light.ttf'),
    'Poppins-Regular': require('./assets/fonts/poppins/Poppins-Regular.ttf'),
    'Poppins-Medium': require('./assets/fonts/poppins/Poppins-Medium.ttf'),
    'Poppins-SemiBold': require('./assets/fonts/poppins/Poppins-SemiBold.ttf'),
    'Poppins-Bold': require('./assets/fonts/poppins/Poppins-Bold.ttf'),
    'Moonlight': require('./assets/fonts/moonlight/Moonlight.ttf'),
  });
  const [showWelcome, setShowWelcome] = useState(true);
  const [isTransitioning, setIsTransitioning] = useState(false);
  const welcomeOpacity = useRef(new Animated.Value(1)).current;
  const welcomeScale = useRef(new Animated.Value(1)).current;
  const homeOpacity = useRef(new Animated.Value(0)).current;
  const homeScale = useRef(new Animated.Value(0.95)).current;
  const backgroundOpacity = useRef(new Animated.Value(0)).current;

  // Reset animation values when needed
  const resetAnimationValues = () => {
    welcomeOpacity.setValue(1);
    welcomeScale.setValue(1);
    homeOpacity.setValue(0);
    homeScale.setValue(0.95);
    backgroundOpacity.setValue(0);
  };

  // Reset animation values on component mount
  useEffect(() => {
    resetAnimationValues();
  }, []);

  const handleGetStarted = () => {
    setIsTransitioning(true);
    
    // Create a sophisticated dissipate effect
    Animated.parallel([
      // WelcomeScreen: fade out and scale down (dissipate effect)
      Animated.timing(welcomeOpacity, {
        toValue: 0,
        duration: 800,
        easing: Easing.out(Easing.cubic),
        useNativeDriver: true,
      }),
      Animated.timing(welcomeScale, {
        toValue: 0.8,
        duration: 800,
        easing: Easing.out(Easing.cubic),
        useNativeDriver: true,
      }),
      // HomeScreen: fade in and scale up (emerge effect)
      Animated.timing(homeOpacity, {
        toValue: 1,
        duration: 800,
        easing: Easing.out(Easing.cubic),
        useNativeDriver: true,
      }),
      Animated.timing(homeScale, {
        toValue: 1,
        duration: 800,
        easing: Easing.out(Easing.cubic),
        useNativeDriver: true,
      }),
      // Background: subtle fade to white during transition
      Animated.timing(backgroundOpacity, {
        toValue: 1,
        duration: 400,
        easing: Easing.out(Easing.quad),
        useNativeDriver: true,
      }),
    ]).start(() => {
      setShowWelcome(false);
      setIsTransitioning(false);
      // Reset animation values after a small delay to prevent glitch
      setTimeout(() => {
        resetAnimationValues();
      }, 100);
    });
  };

  if (!fontsLoaded) {
    return <WelcomeScreen onGetStarted={handleGetStarted} />;
  }

  const MainApp = () => (
    <PaperProvider theme={theme}>
      <NavigationContainer>
        <Stack.Navigator screenOptions={{ headerShown: false }}>
          <Stack.Screen name="Main" component={TabNavigator} />
          <Stack.Screen name="RoomAnalysis" component={RoomAnalysisScreen} />
          <Stack.Screen name="TestError" component={TestErrorScreen} />
        </Stack.Navigator>
      </NavigationContainer>
      <StatusBar style="auto" />
    </PaperProvider>
  );

  if (showWelcome && !isTransitioning) {
    return <WelcomeScreen onGetStarted={handleGetStarted} />;
  }

  if (!showWelcome && !isTransitioning) {
    return <MainApp />;
  }

  // During transition, show both screens with dissipate effect
  return (
    <View style={{ flex: 1 }}>
      {/* Background overlay for smooth transition */}
      <Animated.View style={{ 
        position: 'absolute', 
        top: 0, 
        left: 0, 
        right: 0, 
        bottom: 0, 
        backgroundColor: 'white',
        opacity: backgroundOpacity,
        zIndex: 1
      }} />
      
      <Animated.View style={{ 
        position: 'absolute', 
        top: 0, 
        left: 0, 
        right: 0, 
        bottom: 0, 
        opacity: welcomeOpacity,
        transform: [{ scale: welcomeScale }],
        zIndex: 2
      }}>
        <WelcomeScreen onGetStarted={() => {}} />
      </Animated.View>
      <Animated.View style={{ 
        position: 'absolute', 
        top: 0, 
        left: 0, 
        right: 0, 
        bottom: 0, 
        opacity: homeOpacity,
        transform: [{ scale: homeScale }],
        zIndex: 3
      }}>
        <MainApp />
      </Animated.View>
    </View>
  );
}
